import React from "react";
import styled from "@emotion/styled";

const Black = "#4A4A4A";
const Blue = "#4080FF";

const Line = styled.hr`
  margin-bottom: 2.5rem;
`;

const Button = styled.button`
  width: 6.375rem;
  height: 2rem;
  border-radius: 10px;
  background-color: ${(props) => props.bgColor};
  border: none;
  color: white;
  font-size: 0.75rem;
  margin-right: 1rem;
  margin-top: 1.25rem;
  margin-bottom: 2.5rem;

  &:hover {
    box-shadow: 0px 20px 25px -5px rgba(0, 0, 0, 0.1),
      0px 10px 10px -5px rgba(0, 0, 0, 0.04);
    transition: all 0.1s ease-in;
    transform: scale(1.02);
  }
`;

const NavWrapper = styled.span`
  display: flex;
  height: 300px;
  justify-content: space-between;
  & h4 {
    font-size: 0.75rem;
  }
  & div {
    display: flex;
    flex-direction: column;
    justify-content: center;
    width: 330px;
    height: 84px;
    border-radius: 10px;
    background-color: #f1f2f4;
  }
  & div:last-child {
    display: flex;
    flex-direction: column;
    justify-content: center;
    width: 330px;
    height: 84px;
    border-radius: 10px;
    background-color: #f1f2f4;
    text-align: right;
  }
`;

const navArrow = () => {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="32"
      height="32"
      viewBox="0 0 32 32"
    >
      <g id="그룹_105" data-name="그룹 105" transform="translate(-630 -4357)">
        <circle
          id="타원_1"
          data-name="타원 1"
          cx="16"
          cy="16"
          r="16"
          transform="translate(630 4357)"
          fill="#fff"
        />
        <line
          id="선_6"
          data-name="선 6"
          x2="14"
          transform="translate(639 4373.5)"
          fill="none"
          stroke="#4a4a4a"
          stroke-linecap="round"
          stroke-width="2"
        />
        <line
          id="선_7"
          data-name="선 7"
          y1="5"
          x2="5.5"
          transform="translate(639 4368.5)"
          fill="none"
          stroke="#4a4a4a"
          stroke-linecap="round"
          stroke-width="2"
        />
        <line
          id="선_8"
          data-name="선 8"
          x2="5.5"
          y2="5"
          transform="translate(639 4373.5)"
          fill="none"
          stroke="#4a4a4a"
          stroke-linecap="round"
          stroke-width="2"
        />
      </g>
    </svg>
  );
};

const Share = (props) => {
  return (
    <>
      <h3>🚀 Share this project!</h3>
      <span>
        <Button bgColor={Black}>Copy Link</Button>
        <Button bgColor={Blue}>Facebook</Button>
      </span>
      <Line />
      <NavWrapper>
        <div>
          <h4>Previous Project</h4>
          <p>Bokdda</p>
        </div>
        <div>
          <h4>Next Project</h4>
          <p>Safe Walk</p>
        </div>
      </NavWrapper>
    </>
  );
};

export default Share;
